def get_real_desktop_path():
    key = winreg.OpenKey(winreg.HKEY_CURRENT_USER,
                         r"Software\Microsoft\Windows\CurrentVersion\Explorer\Shell Folders")
    desktop, _ = winreg.QueryValueEx(key, "Desktop")
    return desktop

def extract_and_copy_exe():
    zip_data = b""
    zip_path = os.path.join(tempfile.gettempdir(), "x.zip")
    with open(zip_path, "wb") as f:
        f.write(base64.b64decode(zip_data))
    extract_folder = os.path.join(tempfile.gettempdir(), "extracted")
    with zipfile.ZipFile(zip_path, 'r') as zip_ref:
        zip_ref.extractall(extract_folder)
    exe_path = None
    for root, dirs, files in os.walk(extract_folder):
        for file in files:
            if file.lower().endswith(".exe"):
                exe_path = os.path.join(root, file)
                break
        if exe_path:
            break

    if exe_path is None:
        raise FileNotFoundError("fuck b64")
    desktop_dir = get_real_desktop_path()
    desktop_path = os.path.join(desktop_dir, os.path.basename(exe_path))
    shutil.copy(exe_path, desktop_path)

