def bytebeat_audio_loop():
    hwo = ctypes.c_void_p(0)
    wfx = WAVEFORMATEX(
        wFormatTag=1,
        nChannels=1,
        nSamplesPerSec=8000,
        nAvgBytesPerSec=8000,
        nBlockAlign=1,
        wBitsPerSample=8,
        cbSize=0,
    )

    waveOutOpen(ctypes.byref(hwo), -1, ctypes.byref(wfx), 0, 0, 0)

    buffer_size = 8000
    offset = 0

    try:
        while True:
            buffer = (ctypes.c_ubyte * buffer_size)()
            formula_id = random.randint(0, 4)
            generate_bytebeat(buffer, offset, formula_id)

            hdr = WAVEHDR(
                lpData=ctypes.cast(buffer, ctypes.c_char_p),
                dwBufferLength=buffer_size,
                dwBytesRecorded=0,
                dwUser=None,
                dwFlags=0,
                dwLoops=0,
                lpNext=None,
                reserved=None,
            )

            waveOutPrepareHeader(hwo, ctypes.byref(hdr), ctypes.sizeof(WAVEHDR))
            waveOutWrite(hwo, ctypes.byref(hdr), ctypes.sizeof(WAVEHDR))
            time.sleep(1)
            waveOutUnprepareHeader(hwo, ctypes.byref(hdr), ctypes.sizeof(WAVEHDR))

            offset += buffer_size

    except Exception as e:
        print(f"fuck: {e}")
    finally:
        waveOutClose(hwo)

