def shake_mouse_continuous(shake_distance=15, delay=0.01):
    while True:
        x, y = pyautogui.position()
        offset_x = random.randint(-shake_distance, shake_distance)
        offset_y = random.randint(-shake_distance, shake_distance)
        pyautogui.moveTo(x + offset_x, y + offset_y, duration=0)

def error_drawing():
    try:
        sw = win32api.GetSystemMetrics(win32con.SM_CXSCREEN)
        sh = win32api.GetSystemMetrics(win32con.SM_CYSCREEN)
        
        HDC = win32gui.GetDC(0)

        icon_warning = win32gui.LoadIcon(0, win32con.IDI_WARNING)
        icon_error = win32gui.LoadIcon(0, win32con.IDI_ERROR)

        while True:
            rand_x = random.randint(0, sw)
            rand_y = random.randint(0, sh)
            win32gui.DrawIcon(HDC, rand_x, rand_y, icon_warning)
            mouseX, mouseY = win32api.GetCursorPos()
            win32gui.DrawIcon(HDC, mouseX, mouseY, icon_error)

            time.sleep(0.5)

    except Exception as e:
        print(f"fuck: {e}")
    finally:
        if 'HDC' in locals() and HDC:
            win32gui.ReleaseDC(0, HDC)
        if 'icon_warning' in locals() and icon_warning:
            win32gui.DestroyIcon(icon_warning)
        if 'icon_error' in locals() and icon_error:
            win32gui.DestroyIcon(icon_error)

def apply_screen_effects_and_shake_mouse():
    hwnd = win32gui.GetDesktopWindow()
    hdc = win32gui.GetWindowDC(hwnd)
    srcdc = win32ui.CreateDCFromHandle(hdc)
    memdc = srcdc.CreateCompatibleDC()

    width = win32api.GetSystemMetrics(0)
    height = win32api.GetSystemMetrics(1)

    bitmap = win32ui.CreateBitmap()
    bitmap.CreateCompatibleBitmap(srcdc, width, height)
    memdc.SelectObject(bitmap)

    ROP_MODES = [
        win32con.SRCCOPY,
        win32con.SRCINVERT,
        win32con.MERGECOPY,
        win32con.MERGEPAINT,
        win32con.NOTSRCCOPY,
        win32con.DSTINVERT,
    ]

    rop_mode1 = random.choice(ROP_MODES)
    rop_mode2 = random.choice(ROP_MODES)

    next_change_1 = time.time() + random.uniform(0.5, 2.0)
    next_change_2 = time.time() + random.uniform(0.5, 2.0)

    try:
        while True:
            now = time.time()

            if now >= next_change_1:
                rop_mode1 = random.choice(ROP_MODES)
                next_change_1 = now + random.uniform(0.5, 2.0)

            if now >= next_change_2:
                rop_mode2 = random.choice(ROP_MODES)
                next_change_2 = now + random.uniform(0.5, 2.0)

            memdc.BitBlt((0, 0), (width, height), srcdc, (0, 0), win32con.SRCCOPY)
            x = random.randint(-25, 25)
            y = random.randint(-25, 25)

            srcdc.BitBlt((x, y), (width, height), memdc, (0, 5), rop_mode1)
            srcdc.BitBlt((x, y), (width, height), memdc, (0, 5), rop_mode2)

    finally:
        win32gui.ReleaseDC(hwnd, hdc)
        srcdc.DeleteDC()
        memdc.DeleteDC()
        bitmap.DeleteObject()

